import emailBtn from "../images/email.png";

function Footer() {
  return (
    <div>
      <div>
        <a href="mailto:christian6404@gmail.com">
          <img src={emailBtn} alt="email button "></img>
        </a>
      </div>
      <p> &copy; 2023 Christian Smith</p>
    </div>
  );
}

export default Footer;
